import Nav from "../Components/Nav";
import kaviya from "../images/kaviya.png";

const Home = () => {
  return (
    <div className={style.page}>
      <div className={style.profile}>
        <Nav></Nav>
      </div>
      <div>
        <img
          src={kaviya}
          className="max-h-[80px] 
        sm:h-[80px] w-50
        mb-8 
        mx-auto"
          alt="Profile Picture"
        />
      </div>
    </div>
  );
};

const style = {
  page: `flex 
      flex-col
      min-h-[100vh]`,

  profile: `flex-grow 
      bg1 flex 
      flex-col 
      justify-center`,
};

export default Home;
